  url :string = '';

  constructor(location: Location) {
    this.url = location.path(true);
  }
  public get navbar() :string {
    const routesWithoutNavbar = ['/', '/home', '/login', '/register'];
    return routesWithoutNavbar.includes(this.url) ? 'd-none' : '';
  }
}

import { Component, Input } from '@angular/core';
import { NgClass } from '@angular/common';

@Component({
  selector: 'app-button',
  standalone: true,
  imports: [NgClass],
  templateUrl: './button.component.html',
  styleUrl: './button.component.css',
})
export class ButtonComponent {
  @Input()
  label: string = '';

  @Input()
  icon: string = '';

  @Input()
  type: 'normal' | 'primary' | 'secondary' | 'tertiary' = 'normal';

  @Input()
  solid: boolean = false;

  @Input()
  css: string = '';

  @Input()
  onClickLink: string = '';

  public get classes(): string[] {
    const mode =
      this.type == 'primary'
        ? 'btn-primary'
        : this.type == 'secondary'
          ? 'btn-secondary'
          : this.type == 'tertiary'
            ? 'btn-tertiary'
            : '';

    return ['btn', mode, this.solid ? 'btn-solid' : '', this.css];
  }

  public clickFunction() {
    if (this.onClickLink != '') {
      document.location.href = this.onClickLink;
    }
  }
}

